module.exports = /*#__PURE__*/JSON.parse('{"meta":{"title":"Love Eat Keep Fit  Research Group","description":"Join a research group to test a sustainable, neuroscience-informed weight loss method. No dangerous diets. Eat well, enjoy food, lose fat."},"hero":{"title":"Hi, Im Lana.","subtitle":"I\'m a food coach who helps you transform your grocery shopping and cooking routine into a sustainable, healthy lifestyle  without spending hours in the kitchen or eating boring food. You can cook for your entire family and still hit your fitness goals, even on a calorie deficit. After years of experimenting with cooking, weight management, and working with nutritionists, I\'ve identified the pain points we all struggle with on our weight control journey  and found science-based answers on how to prevent your brain and body from sabotaging you. I\'ll show you how to get the nutrients you need to avoid cravings and overeating habits that derail weight loss. Plus, I offer motivational support groups and individual coaching  because accountability is often the hardest part when you\'re on your own in your weight management journey.","ctaPrimary":"Participate","ctaSecondary":"Book your spot"},"story":{"heading":"If any of these sounds like you","short":"Its not willpower. Its the daily friction around food.","introHeading":"The real problem","intro":"If so, you\'re not alone. Maybe you need more motivation or accountability, but that\'s not the real problem. You need a system that actually fits real life. Diets do not work. Lifestyle changes do: new habits around food, a new way to organize your cooking, and new knowledge about food composition and how it affects us when approached improperly.","painHeading":"Where the struggle shows up","painPoints":[{"title":"Meal plan burnout","description":"You start strong, then fall off because cooking and grocery shopping take too much time and energy."},{"title":"Life on pause","description":"It feels like you have to put your life on hold just to organize food for your goals."},{"title":"Bland food fatigue","description":"Diets feel boring, so you slide back into fast food or sweets."},{"title":"No grocery system","description":"Youre unsure how to plan groceries and end up at the shop every second day."},{"title":"Calorie overload","description":"Tracking feels overwhelming  one more task on your to-do list."},{"title":"Reset cycle","description":"You do well for a week, then life happens and everything resets."},{"title":"Protein without meat","description":"You dont eat meat and struggle to hit your protein needs."},{"title":"No-workout preference","description":"Youre not into sport and want results without crazy workouts."}],"bridgeHeading":"Youre not the problem","bridge":"These arent personal failures  theyre design problems. Most plans ignore how busy life is and how your brain reacts to restriction.","solutionHeading":"A system that fits real life","solution":"Believe me, I was there. I know every pain on this list and more. Thats why I built a system that makes healthy eating simple, grocery shopping quick, food tasty, and weight-goal management sustainable long term. It fits into a busy lifestyle."},"coreOffer":{"heading":"What my coaching gives you","items":["Personal accountability that keeps you consistent","Supportive community plus 1:1 guidance when you need it","Simple cooking routines with quick, tasty recipes","A grocery system that saves time and reduces stress","Sustainable weight management without restriction or guilt","Macro and calorie guidance tailored to your goals"]},"whatWeDo":{"heading":"Inside the coaching","items":["Identify your personal goal clearly.","Calculate your daily calorie needs based on your lifestyle and activity.","Learn what macros are and why they matter with simple tools.","Lose fat without losing muscle.","Manage cravings and understand your bodys signals.","Eat tasty, quick, lowstress meals.","Readymade shopping lists to shop in 5 minutes.","Weekly checkins and ongoing support.","Sustainable workouts that dont drain your energy.","Exercise is NOT required: you can walk, do light activity, or no exercise  but without movement youll eat a bit less and increasing metabolism is harder without muscle or cardio.","Main goal: increase your metabolism, not slow it down."]},"signup":{"heading":"Join the research group","ctaHeading":"Ready to take the next step?","ctaText":"Fill out the form below to get started with my coaching and receive your next steps by email.","name":"Name","email":"Email","phone":"Phone (optional)","goal":"Goal","goalOptions":["Lose weight","Get lean","Learn cooking for diet and fitness","Maintain weight (stop gaining)","Other"],"why":"Why do you want to join? (optional)","submit":"Participate","success":"Thanks! I received your submission and will get back to you shortly with the next steps. Please check your email in a little while.","afterSubmitSecondaryCta":"Message on Instagram"},"social":{"instagramHandle":"loveeatkeepfit","instagramUrl":"https://instagram.com/loveeatkeepfit","instagramCta":"Message on Instagram"},"footer":{"disclaimer":"Im not a certified nutritionist. Ive worked with nutritionists, tested approaches on myself, and observed real people. This is a research phase.","contact":"Contact via WhatsApp","contactInstagram":"Instagram: @loveeatkeepfit"}}');

